var title_f0_23_377="Physical findings - Juvenile dermatomyositis";
var content_f0_23_377=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F63190&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F63190&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 476px\">",
"   <div class=\"ttl\">",
"    Features of juvenile dermatomyositis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 456px; height: 501px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A) Perivascular and perifascicular inflammatory infiltrates with necrotic fibres, perifascicular atrophy and regeneration in a muscle biopsy. B) MRI is a sensitive indicator of myositis. Inflamed areas appear bright on short-tau inversion recovery-weighted images (arrows). C) Capillaries are most often abnormal when viewed at the nailfold. Typical changes of dilatation with adjacent drop out (arrow) is seen. D) About 30 percent of JDM patients have dystrophic calcinosis. E) Cutaneous ulceration with central necrosis, crust and surrounding erythema at the elbow of a 10-year-old boy with severe JDM. F) Lipoatrophy of the forearm (arrow) in a boy with JDM.",
"    <div class=\"footnotes\">",
"     JDM: juvenile dermatomyositis.",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Feldman, BM, Rider, LG, Reed, AM, Pachman, LM. Juvenile dermatomyositis and other idiopathic inflammatory myopathies of childhood. Lancet 2008; 371:2201. Illustration used with permission of Elsevier Inc. All rights reserved. Copyright &copy;2008 Elsevier Inc.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
